--
-- SQLite database script converted from PostgreSQL Pagila
-- Fixed trigger syntax for SQLite compatibility
--

-- Table: actor
CREATE TABLE actor (
    actor_id INTEGER PRIMARY KEY AUTOINCREMENT,
    first_name TEXT NOT NULL,
    last_name TEXT NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL
);

-- Table: category
CREATE TABLE category (
    category_id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL
);

-- Table: language
CREATE TABLE language (
    language_id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL
);

-- Table: film
CREATE TABLE film (
    film_id INTEGER PRIMARY KEY AUTOINCREMENT,
    title TEXT NOT NULL,
    description TEXT,
    release_year INTEGER CHECK ((release_year >= 1901) AND (release_year <= 2155)),
    language_id INTEGER NOT NULL,
    original_language_id INTEGER,
    rental_duration INTEGER DEFAULT 3 NOT NULL,
    rental_rate REAL DEFAULT 4.99 NOT NULL,
    length INTEGER,
    replacement_cost REAL DEFAULT 19.99 NOT NULL,
    rating TEXT DEFAULT 'G' CHECK (rating IN ('G', 'PG', 'PG-13', 'R', 'NC-17')),
    last_update TEXT DEFAULT (datetime('now')) NOT NULL,
    special_features TEXT,
    fulltext TEXT,
    FOREIGN KEY (language_id) REFERENCES language (language_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (original_language_id) REFERENCES language (language_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: film_actor
CREATE TABLE film_actor (
    actor_id INTEGER NOT NULL,
    film_id INTEGER NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL,
    PRIMARY KEY (actor_id, film_id),
    FOREIGN KEY (actor_id) REFERENCES actor (actor_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (film_id) REFERENCES film (film_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: film_category
CREATE TABLE film_category (
    film_id INTEGER NOT NULL,
    category_id INTEGER NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL,
    PRIMARY KEY (film_id, category_id),
    FOREIGN KEY (film_id) REFERENCES film (film_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (category_id) REFERENCES category (category_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: country
CREATE TABLE country (
    country_id INTEGER PRIMARY KEY AUTOINCREMENT,
    country TEXT NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL
);

-- Table: city
CREATE TABLE city (
    city_id INTEGER PRIMARY KEY AUTOINCREMENT,
    city TEXT NOT NULL,
    country_id INTEGER NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL,
    FOREIGN KEY (country_id) REFERENCES country (country_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: address
CREATE TABLE address (
    address_id INTEGER PRIMARY KEY AUTOINCREMENT,
    address TEXT NOT NULL,
    address2 TEXT,
    district TEXT NOT NULL,
    city_id INTEGER NOT NULL,
    postal_code TEXT,
    phone TEXT NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL,
    FOREIGN KEY (city_id) REFERENCES city (city_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: store
CREATE TABLE store (
    store_id INTEGER PRIMARY KEY AUTOINCREMENT,
    manager_staff_id INTEGER NOT NULL,
    address_id INTEGER NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL,
    FOREIGN KEY (address_id) REFERENCES address (address_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: staff
CREATE TABLE staff (
    staff_id INTEGER PRIMARY KEY AUTOINCREMENT,
    first_name TEXT NOT NULL,
    last_name TEXT NOT NULL,
    address_id INTEGER NOT NULL,
    picture BLOB,
    email TEXT,
    store_id INTEGER NOT NULL,
    active INTEGER DEFAULT 1 NOT NULL,
    username TEXT NOT NULL,
    password TEXT,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL,
    FOREIGN KEY (address_id) REFERENCES address (address_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (store_id) REFERENCES store (store_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: customer
CREATE TABLE customer (
    customer_id INTEGER PRIMARY KEY AUTOINCREMENT,
    store_id INTEGER NOT NULL,
    first_name TEXT NOT NULL,
    last_name TEXT NOT NULL,
    email TEXT,
    address_id INTEGER NOT NULL,
    activebool INTEGER DEFAULT 1 NOT NULL,
    create_date TEXT DEFAULT (date('now')) NOT NULL,
    last_update TEXT DEFAULT (datetime('now')),
    active INTEGER,
    FOREIGN KEY (address_id) REFERENCES address (address_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (store_id) REFERENCES store (store_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: inventory
CREATE TABLE inventory (
    inventory_id INTEGER PRIMARY KEY AUTOINCREMENT,
    film_id INTEGER NOT NULL,
    store_id INTEGER NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL,
    FOREIGN KEY (film_id) REFERENCES film (film_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (store_id) REFERENCES store (store_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: rental
CREATE TABLE rental (
    rental_id INTEGER PRIMARY KEY AUTOINCREMENT,
    rental_date TEXT NOT NULL,
    inventory_id INTEGER NOT NULL,
    customer_id INTEGER NOT NULL,
    return_date TEXT,
    staff_id INTEGER NOT NULL,
    last_update TEXT DEFAULT (datetime('now')) NOT NULL,
    FOREIGN KEY (customer_id) REFERENCES customer (customer_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (inventory_id) REFERENCES inventory (inventory_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (staff_id) REFERENCES staff (staff_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

-- Table: payment
CREATE TABLE payment (
    payment_id INTEGER PRIMARY KEY AUTOINCREMENT,
    customer_id INTEGER NOT NULL,
    staff_id INTEGER NOT NULL,
    rental_id INTEGER NOT NULL,
    amount REAL NOT NULL,
    payment_date TEXT NOT NULL,
    FOREIGN KEY (customer_id) REFERENCES customer (customer_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (staff_id) REFERENCES staff (staff_id) ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (rental_id) REFERENCES rental (rental_id) ON UPDATE CASCADE ON DELETE RESTRICT
);

--
-- Views
--

-- View: actor_info
CREATE VIEW actor_info AS
SELECT a.actor_id,
    a.first_name,
    a.last_name,
    GROUP_CONCAT(DISTINCT ((c.name || ': ' ) || ( SELECT GROUP_CONCAT(f.title)
        FROM ((film f
        JOIN film_category fc_1 ON ((f.film_id = fc_1.film_id)))
        JOIN film_actor fa_1 ON ((f.film_id = fa_1.film_id)))
        WHERE ((fc_1.category_id = c.category_id) AND (fa_1.actor_id = a.actor_id))
        GROUP BY fa_1.actor_id))) AS film_info
FROM (((actor a
    LEFT JOIN film_actor fa ON ((a.actor_id = fa.actor_id)))
    LEFT JOIN film_category fc ON ((fa.film_id = fc.film_id)))
    LEFT JOIN category c ON ((fc.category_id = c.category_id)))
GROUP BY a.actor_id, a.first_name, a.last_name;

-- View: customer_list
CREATE VIEW customer_list AS
SELECT cu.customer_id AS id,
    ((cu.first_name || ' ' ) || cu.last_name) AS name,
    a.address,
    a.postal_code AS "zip code",
    a.phone,
    city.city,
    country.country,
    CASE
        WHEN cu.activebool THEN 'active'
        ELSE ''
    END AS notes,
    cu.store_id AS sid
FROM (((customer cu
    JOIN address a ON ((cu.address_id = a.address_id)))
    JOIN city ON ((a.city_id = city.city_id)))
    JOIN country ON ((city.country_id = country.country_id)));

-- View: film_list
CREATE VIEW film_list AS
SELECT film.film_id AS fid,
    film.title,
    film.description,
    category.name AS category,
    film.rental_rate AS price,
    film.length,
    film.rating,
    GROUP_CONCAT(((actor.first_name || ' ' ) || actor.last_name)) AS actors
FROM ((((category
    LEFT JOIN film_category ON ((category.category_id = film_category.category_id)))
    LEFT JOIN film ON ((film_category.film_id = film.film_id)))
    JOIN film_actor ON ((film.film_id = film_actor.film_id)))
    JOIN actor ON ((film_actor.actor_id = actor.actor_id)))
GROUP BY film.film_id, film.title, film.description, category.name, film.rental_rate, film.length, film.rating;

-- View: sales_by_film_category
CREATE VIEW sales_by_film_category AS
SELECT c.name AS category,
    sum(p.amount) AS total_sales
FROM (((((payment p
    JOIN rental r ON ((p.rental_id = r.rental_id)))
    JOIN inventory i ON ((r.inventory_id = i.inventory_id)))
    JOIN film f ON ((i.film_id = f.film_id)))
    JOIN film_category fc ON ((f.film_id = fc.film_id)))
    JOIN category c ON ((fc.category_id = c.category_id)))
GROUP BY c.name
ORDER BY (sum(p.amount)) DESC;

