-- Note: SQLite doesn't allow modifying NEW values in BEFORE triggers
-- These triggers won't auto-update last_update. For that functionality,
-- you'd need to handle it in your application code.
--
-- Alternative: If you need auto-updating timestamps, don't use triggers.
-- Instead, always include last_update in your UPDATE statements explicitly.


